import React, { Component } from 'react';

export class StoresData extends Component {
    static displayName = StoresData.name;

    constructor(props) {
        super(props);
        this.state = { stores: [], loading: true };
    }

    componentDidMount() {
        this.StoresData();
    }

    static renderStores(storess) {
        return (
            <section className="row">

                {stores.map(stores =>
                    <div class="col-12" key={stores.name}>
                        <span class="image left special"><img class="" src={stores.logo}></img></span>
                        <h3>{stores.name}</h3>
                        <p>
                            Adipiscing dis a mus a convallis lum commodo habitasse suspendisse magnis.
						</p>
                    </div>                              
                       )
    }     
            </section>
        );
    }

render() {
    let contents = this.state.loading
        ? <p><em>Loading...</em></p>
        : StoresData.renderStores(this.state.storess);
    return (
        <section id="main">
            <header id="header">
                <div>Snapshot <span>by TEMPLATED</span></div>
            </header>
            <section id="contact">
                <div class="social column">
                   <h3>Stores</h3>
                    {contents}
                </div>
                <div class="column">
                    <h3>ProductVariety</h3>
                    {contents}
                </div>

            </section>
        </section>
    );
}

async StoresData() {
    const response = await fetch('api/store');
    const data = await response.json();
    this.setState({ stores: data, loading: false });
}
}
